import React from 'react'
import MovieCard from './MovieCard'

const Movielist = ({title, movie}) => {
    console.log(movie);
  return (
    <div className='p-4 z-30 mt-1'>
        <h1 className=' pb-3 text-[1.75rem] text-white'>{title}</h1>
        <div className='flex overfow-x-scroll'>
            
            <div className='flex gap-2 overflow-x-scroll scrollbar-hide'>
                {
                    movie.map(mov=><MovieCard  key={mov.id} posterPath={mov.poster_path}/>)
                    }
            </div>
        </div>
    </div>
  )
}

export default Movielist
